var DEFAULT_PASSWORD_POLICY = {
  maxLength: 128,
  minLength: 8,
  minStrengthScore: 60,
  preventCommonPasswords: true,
  preventPersonalInfo: true,
  requireLowercase: true,
  requireNumbers: true,
  requireSpecialChars: true,
  requireUppercase: true
};
var COMMON_PASSWORDS = new Set([
  "password",
  "123456",
  "password123",
  "admin",
  "letmein",
  "welcome",
  "monkey",
  "1234567890",
  "qwerty",
  "abc123",
  "Password1",
  "123123",
  "111111",
  "iloveyou",
  "123123123",
  "password1",
  "12345678",
  "sunshine",
  "princess",
  "admin123",
  "welcome1",
  "monkey123",
  "password2",
  "123456789",
  "dragon",
  "master",
  "hello",
  "freedom",
  "whatever",
  "qazwsx",
  "trustno1",
  "123qwe",
  "1q2w3e4r",
  "zxcvbnm",
  "123abc",
  "password!",
  "football",
  "senha",
  "12345678",
  "senha123",
  "123mudar",
  "brasil",
  "cidade",
  "123456",
  "12345",
  "senha1",
  "administrador"
]);
var CHARACTER_SETS = {
  uppercase: /[A-Z]/,
  lowercase: /[a-z]/,
  numbers: /[0-9]/,
  special: /[!@#$%^&*()_+\-=[\]{};':"\\|,.<>/?~`]/,
  brazilian: /[]/
};
function containsPersonalInfo(password, email3, name) {
  if (!email3 && !name) {
    return false;
  }
  const lowerPassword = password.toLowerCase();
  if (email3) {
    const emailParts = email3.toLowerCase().split("@");
    const emailLocal = emailParts[0];
    const emailDomain = emailParts[1];
    const cleanEmailLocal = emailLocal.replace(/[._-]/g, "");
    if (lowerPassword.includes(cleanEmailLocal)) {
      return true;
    }
    if (emailDomain && lowerPassword.includes(emailDomain.split(".")[0])) {
      return true;
    }
  }
  if (name) {
    const nameParts = name.toLowerCase().split(/[\s._-]+/);
    for (const part of nameParts) {
      if (part.length >= 3 && lowerPassword.includes(part)) {
        return true;
      }
    }
  }
  return false;
}
function calculatePasswordStrength(password) {
  let score = 0;
  if (password.length >= 8) {
    score += 20;
  }
  if (password.length >= 12) {
    score += 10;
  }
  if (password.length >= 16) {
    score += 10;
  }
  if (CHARACTER_SETS.lowercase.test(password)) {
    score += 10;
  }
  if (CHARACTER_SETS.uppercase.test(password)) {
    score += 10;
  }
  if (CHARACTER_SETS.numbers.test(password)) {
    score += 10;
  }
  if (CHARACTER_SETS.special.test(password)) {
    score += 10;
  }
  const hasRepeatingChars = /(.)\1{2,}/.test(password);
  const hasSequentialChars = /(012|123|234|345|456|567|678|789|890|abc|bcd|cde|def|efg|fgh|ghi|hij|ijk|jkl|klm|lmn|mno|nop|opq|pqr|qrs|rst|stu|tuv|uvw|vwx|wxy|xyz)/i.test(password);
  const hasKeyboardPattern = /(qwerty|asdf|zxcv|1234|abcd)/i.test(password);
  if (!hasRepeatingChars) {
    score += 7;
  }
  if (!hasSequentialChars) {
    score += 7;
  }
  if (!hasKeyboardPattern) {
    score += 6;
  }
  return Math.min(score, 100);
}
function validatePassword(password, config2 = DEFAULT_PASSWORD_POLICY, context) {
  const errors5 = [];
  const warnings = [];
  const suggestions = [];
  if (password.length < config2.minLength) {
    errors5.push(`Password must be at least ${config2.minLength} characters long`);
  }
  if (password.length > config2.maxLength) {
    errors5.push(`Password must be no more than ${config2.maxLength} characters long`);
  }
  if (config2.requireUppercase && !CHARACTER_SETS.uppercase.test(password)) {
    errors5.push("Password must contain at least one uppercase letter");
  }
  if (config2.requireLowercase && !CHARACTER_SETS.lowercase.test(password)) {
    errors5.push("Password must contain at least one lowercase letter");
  }
  if (config2.requireNumbers && !CHARACTER_SETS.numbers.test(password)) {
    errors5.push("Password must contain at least one number");
  }
  if (config2.requireSpecialChars && !CHARACTER_SETS.special.test(password)) {
    errors5.push("Password must contain at least one special character (!@#$%^&* etc.)");
  }
  if (config2.preventCommonPasswords) {
    const lowerPassword = password.toLowerCase();
    if (COMMON_PASSWORDS.has(lowerPassword)) {
      errors5.push("Password is too common and easily guessable");
    }
  }
  if (config2.preventPersonalInfo && context) {
    if (containsPersonalInfo(password, context.email, context.name)) {
      errors5.push("Password must not contain personal information (name, email, etc.)");
    }
  }
  const score = calculatePasswordStrength(password);
  if (score < 40) {
    warnings.push("Password is very weak and easily compromised");
  } else if (score < 60) {
    warnings.push("Password could be stronger for better security");
  }
  if (score < config2.minStrengthScore) {
    errors5.push(`Password strength score ${score} is below minimum required ${config2.minStrengthScore}`);
  }
  if (score < 80) {
    suggestions.push("Use a longer password (12+ characters recommended)");
    if (!CHARACTER_SETS.uppercase.test(password)) {
      suggestions.push("Add uppercase letters");
    }
    if (!CHARACTER_SETS.lowercase.test(password)) {
      suggestions.push("Add lowercase letters");
    }
    if (!CHARACTER_SETS.numbers.test(password)) {
      suggestions.push("Add numbers");
    }
    if (!CHARACTER_SETS.special.test(password)) {
      suggestions.push("Add special characters");
    }
    suggestions.push("Avoid common patterns and dictionary words");
    suggestions.push('Consider using a passphrase (e.g., "correct-horse-battery-staple")');
  }
  return {
    errors: errors5,
    isValid: errors5.length === 0 && score >= config2.minStrengthScore,
    score,
    suggestions,
    warnings
  };
}

// src/lib/security/rate-limiter.ts
var RATE_LIMIT_CONFIGS = {
  apiGeneral: {
    windowMs: 15 * 60 * 1000,
    maxAttempts: 100,
    lockoutDuration: 5 * 60 * 1000,
    progressiveDelay: false
  },
  authentication: {
    windowMs: 15 * 60 * 1000,
    maxAttempts: 5,
    lockoutDuration: 30 * 60 * 1000,
    progressiveDelay: true
  },
  financialOperations: {
    windowMs: 60 * 60 * 1000,
    maxAttempts: 20,
    lockoutDuration: 60 * 60 * 1000,
    progressiveDelay: true
  },
  passwordReset: {
    windowMs: 60 * 60 * 1000,
    maxAttempts: 3,
    lockoutDuration: 2 * 60 * 60 * 1000,
    progressiveDelay: true
  }
};

class RateLimiter {
  attempts = new Map;
  config;
  securityEvents = [];
  cleanupInterval;
  constructor(config2) {
    this.config = config2;
    this.cleanupInterval = setInterval(() => {
      this.cleanup();
    }, 60 * 1000);
  }
  canAttempt(identifier) {
    const record2 = this.getRecord(identifier);
    const now = Date.now();
    if (record2.isLocked && record2.lockUntil && record2.lockUntil > now) {
      const retryAfter = Math.ceil((record2.lockUntil - now) / 1000);
      return {
        allowed: false,
        reason: "Account temporarily locked due to too many failed attempts",
        retryAfter
      };
    }
    const windowStart = now - this.config.windowMs;
    if (record2.attempts >= this.config.maxAttempts && record2.lastAttempt > windowStart) {
      if (this.config.progressiveDelay) {
        const delayMs = this.calculateProgressiveDelay(record2.attempts);
        const timeSinceLastAttempt = now - record2.lastAttempt;
        if (timeSinceLastAttempt < delayMs) {
          const retryAfter = Math.ceil((delayMs - timeSinceLastAttempt) / 1000);
          return {
            allowed: false,
            reason: "Rate limit exceeded. Please wait before trying again.",
            retryAfter
          };
        }
      } else {
        const retryAfter = Math.ceil((record2.lastAttempt + this.config.windowMs - now) / 1000);
        return {
          allowed: false,
          reason: "Rate limit exceeded",
          retryAfter
        };
      }
    }
    return { allowed: true };
  }
  recordAttempt(identifier, success2 = true) {
    const now = Date.now();
    const record2 = this.getRecord(identifier);
    if (success2) {
      this.attempts.set(identifier, {
        attempts: 0,
        firstAttempt: now,
        isLocked: false,
        lastAttempt: now
      });
      this.logSecurityEvent("login_attempt", identifier, { success: true });
    } else {
      record2.attempts += 1;
      record2.lastAttempt = now;
      if (record2.attempts >= this.config.maxAttempts) {
        record2.isLocked = true;
        record2.lockUntil = now + this.config.lockoutDuration;
        this.logSecurityEvent("account_locked", identifier, {
          attempts: record2.attempts,
          lockoutDuration: this.config.lockoutDuration
        });
      } else {
        this.logSecurityEvent("login_attempt", identifier, {
          attempts: record2.attempts,
          success: false
        });
      }
      this.attempts.set(identifier, record2);
    }
  }
  getStatus(identifier) {
    const record2 = this.getRecord(identifier);
    const now = Date.now();
    if (record2.isLocked && record2.lockUntil && record2.lockUntil <= now) {
      record2.isLocked = false;
      record2.lockUntil = undefined;
      record2.attempts = 0;
      this.logSecurityEvent("account_unlocked", identifier);
      this.attempts.set(identifier, record2);
    }
    return record2;
  }
  getSecurityEvents(limit = 100) {
    return this.securityEvents.sort((a, b) => b.timestamp - a.timestamp).slice(0, limit);
  }
  calculateProgressiveDelay(attempts) {
    const delayMs = Math.min(2 ** attempts * 1000, 5 * 60 * 1000);
    return delayMs;
  }
  getRecord(identifier) {
    const existing = this.attempts.get(identifier);
    if (existing) {
      return existing;
    }
    const newRecord = {
      attempts: 0,
      firstAttempt: Date.now(),
      isLocked: false,
      lastAttempt: Date.now()
    };
    this.attempts.set(identifier, newRecord);
    return newRecord;
  }
  cleanup() {
    const now = Date.now();
    const windowStart = now - this.config.windowMs;
    for (const [identifier, record2] of this.attempts.entries()) {
      if (!record2.isLocked && record2.lastAttempt < windowStart) {
        this.attempts.delete(identifier);
      }
    }
    if (this.securityEvents.length > 1000) {
      this.securityEvents = this.securityEvents.slice(-1000);
    }
  }
  logSecurityEvent(type, identifier, details) {
    const event = {
      details,
      identifier,
      timestamp: Date.now(),
      type
    };
    this.securityEvents.push(event);
    try {
      const { secureLogger: secureLogger2 } = (init_secure_logger(), __toCommonJS(exports_secure_logger));
      if (type === "rate_limit_exceeded" || type === "account_locked") {
        secureLogger2.security(`Rate limit security event: ${type}`, {
          identifier,
          timestamp: new Date(event.timestamp).toISOString(),
          ...details,
          component: "rate-limiter"
        });
      } else {
        secureLogger2.warn(`Security event: ${type}`, {
          identifier,
          timestamp: new Date(event.timestamp).toISOString(),
          ...details,
          component: "rate-limiter"
        });
      }
    } catch {
      if (type === "rate_limit_exceeded" || type === "account_locked") {}
    }
  }
  destroy() {
    if (this.cleanupInterval) {
      clearInterval(this.cleanupInterval);
    }
    this.attempts.clear();
    this.securityEvents = [];
  }
}
var rateLimiters = {
  apiGeneral: new RateLimiter(RATE_LIMIT_CONFIGS.apiGeneral),
  authentication: new RateLimiter(RATE_LIMIT_CONFIGS.authentication),
  financialOperations: new RateLimiter(RATE_LIMIT_CONFIGS.financialOperations),
  passwordReset: new RateLimiter(RATE_LIMIT_CONFIGS.passwordReset)
};
function getClientIP(req) {
  return (Array.isArray(req.headers["x-forwarded-for"]) ? req.headers["x-forwarded-for"][0] : req.headers["x-forwarded-for"]?.split(",")[0]) || req.headers["x-real-ip"] || req.connection?.remoteAddress || req.socket?.remoteAddress || req.ip || "unknown";
}
function checkAuthenticationRateLimit(email3, ip) {
  const emailLimit = rateLimiters.authentication.canAttempt(email3);
  const ipLimit = rateLimiters.apiGeneral.canAttempt(ip);
  if (!emailLimit.allowed) {
    return emailLimit;
  }
  if (!ipLimit.allowed) {
    return ipLimit;
  }
  return { allowed: true };
}
function recordAuthenticationAttempt(email3, ip, success2) {
  rateLimiters.authentication.recordAttempt(email3, success2);
  rateLimiters.apiGeneral.recordAttempt(ip, success2);
}

