var googleCalendarRouter = router({
  getSyncHistory: protectedProcedure.input(exports_external.object({
    limit: exports_external.number().min(1).max(50).default(10)
  })).query(async ({ ctx, input }) => {
    const userId = ctx.user.id;
    const { data, error: error46 } = await ctx.supabase.from("calendar_sync_audit").select("*").eq("user_id", userId).order("created_at", { ascending: false }).limit(input.limit);
    if (error46) {
      throw new TRPCError({ code: "INTERNAL_SERVER_ERROR", message: error46.message });
    }
    return data;
  }),
  getSyncSettings: protectedProcedure.query(async ({ ctx }) => {
    const userId = ctx.user.id;
    const { data, error: error46 } = await ctx.supabase.from("calendar_sync_settings").select("*").eq("user_id", userId).single();
    if (error46 && error46.code !== "PGRST116") {
      throw new TRPCError({
        cause: error46,
        code: "INTERNAL_SERVER_ERROR",
        message: "Failed to fetch settings"
      });
    }
    return data;
  }),
  getSyncStatus: protectedProcedure.query(async ({ ctx }) => {
    const userId = ctx.user.id;
    const { data: settings } = await ctx.supabase.from("calendar_sync_settings").select("*").eq("user_id", userId).single();
    const { data: tokens } = await ctx.supabase.from("google_calendar_tokens").select("google_user_email, updated_at, expiry_timestamp").eq("user_id", userId).single();
    const { data: lastSync } = await ctx.supabase.from("calendar_sync_audit").select("created_at, details").eq("user_id", userId).eq("action", "sync_completed").order("created_at", { ascending: false }).limit(1).single();
    return {
      email: tokens?.google_user_email,
      isConnected: !!tokens,
      lastSync: lastSync?.created_at,
      settings,
      tokenExpiry: tokens?.expiry_timestamp
    };
  }),
  requestFullSync: protectedProcedure.mutation(async ({ ctx }) => {
    const { data, error: error46 } = await ctx.supabase.functions.invoke("google-calendar-sync", {
      body: { action: "full_sync" }
    });
    if (error46) {
      throw new TRPCError({ code: "INTERNAL_SERVER_ERROR", message: error46.message });
    }
    if (data.error) {
      throw new TRPCError({ code: "BAD_REQUEST", message: data.error });
    }
    return data;
  }),
  requestIncrementalSync: protectedProcedure.mutation(async ({ ctx }) => {
    const { data, error: error46 } = await ctx.supabase.functions.invoke("google-calendar-sync", {
      body: { action: "incremental_sync" }
    });
    if (error46) {
      throw new TRPCError({ code: "INTERNAL_SERVER_ERROR", message: error46.message });
    }
    return data;
  }),
  syncEvent: protectedProcedure.input(exports_external.object({
    direction: exports_external.enum(["to_google", "from_google"]).default("to_google"),
    eventId: exports_external.string()
  })).mutation(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.functions.invoke("google-calendar-sync", {
      body: {
        action: input.direction === "to_google" ? "sync_to_google" : "sync_from_google",
        event_id: input.eventId
      }
    });
    if (error46) {
      throw new TRPCError({ code: "INTERNAL_SERVER_ERROR", message: error46.message });
    }
    if (data.error) {
      throw new TRPCError({ code: "BAD_REQUEST", message: data.error });
    }
    return data;
  }),
  updateSyncSettings: protectedProcedure.input(exports_external.object({
    auto_sync_interval_minutes: exports_external.number().min(5).optional(),
    sync_categories: exports_external.array(exports_external.string()).nullable().optional(),
    sync_direction: exports_external.enum(["one_way_to_google", "one_way_from_google", "bidirectional"]).optional(),
    sync_enabled: exports_external.boolean().optional(),
    sync_financial_amounts: exports_external.boolean().optional()
  })).mutation(async ({ ctx, input }) => {
    const userId = ctx.user.id;
    const { data, error: error46 } = await ctx.supabase.from("calendar_sync_settings").upsert({
      user_id: userId,
      ...input,
      updated_at: new Date().toISOString()
    }).select().single();
    if (error46) {
      throw new TRPCError({
        cause: error46,
        code: "INTERNAL_SERVER_ERROR",
        message: "Failed to update settings"
      });
    }
    await ctx.supabase.from("calendar_sync_audit").insert({
      action: "sync_updated",
      user_id: userId
    });
    return data;
  })
});

