var pixKeyTypeSchema = exports_external.enum(["email", "cpf", "cnpj", "phone", "random"]);
var transactionTypeSchema = exports_external.enum(["sent", "received", "scheduled"]);
var transactionStatusSchema = exports_external.enum([
  "pending",
  "processing",
  "completed",
  "failed",
  "cancelled"
]);
var createPixKeySchema = exports_external.object({
  isFavorite: exports_external.boolean().default(false),
  keyType: pixKeyTypeSchema,
  keyValue: exports_external.string().min(1, "Chave PIX  obrigatria"),
  label: exports_external.string().optional()
});
var createPixTransactionSchema = exports_external.object({
  amount: exports_external.number().positive("Valor deve ser maior que zero"),
  description: exports_external.string().optional(),
  pixKey: exports_external.string().min(1, "Chave PIX  obrigatria"),
  pixKeyType: pixKeyTypeSchema,
  recipientDocument: exports_external.string().optional(),
  recipientName: exports_external.string().optional(),
  scheduledDate: exports_external.string().datetime().optional(),
  transactionType: transactionTypeSchema
});
var generateQRCodeSchema = exports_external.object({
  amount: exports_external.number().positive().optional(),
  description: exports_external.string().optional(),
  expiresInMinutes: exports_external.number().positive().optional(),
  maxUses: exports_external.number().positive().optional(),
  pixKey: exports_external.string().min(1, "Chave PIX  obrigatria")
});
var getTransactionsSchema = exports_external.object({
  endDate: exports_external.string().datetime().optional(),
  limit: exports_external.number().int().positive().max(100).default(50),
  offset: exports_external.number().int().nonnegative().default(0),
  startDate: exports_external.string().datetime().optional(),
  status: transactionStatusSchema.optional(),
  type: transactionTypeSchema.optional()
});
var getStatsSchema = exports_external.object({
  period: exports_external.enum(["24h", "7d", "30d", "1y"]).default("30d")
});
var pixRouter = router({
  getKeys: protectedProcedure.query(async ({ ctx }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_keys").select("*").eq("user_id", ctx.user.id).eq("is_active", true).order("is_favorite", { ascending: false }).order("created_at", { ascending: false });
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao buscar chaves PIX: ${error46.message}`
      });
    }
    return data;
  }),
  getFavorites: protectedProcedure.query(async ({ ctx }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_keys").select("*").eq("user_id", ctx.user.id).eq("is_active", true).eq("is_favorite", true).order("created_at", { ascending: false });
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao buscar favoritos: ${error46.message}`
      });
    }
    return data;
  }),
  createKey: protectedProcedure.input(createPixKeySchema).mutation(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_keys").insert({
      is_active: true,
      is_favorite: input.isFavorite,
      key_type: input.keyType,
      key_value: input.keyValue,
      label: input.label,
      user_id: ctx.user.id
    }).select().single();
    if (error46) {
      if (error46.code === "23505") {
        throw new TRPCError({
          code: "CONFLICT",
          message: "Esta chave PIX j est cadastrada"
        });
      }
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao criar chave PIX: ${error46.message}`
      });
    }
    return data;
  }),
  updateKey: protectedProcedure.input(exports_external.object({
    id: exports_external.string().uuid(),
    isFavorite: exports_external.boolean().optional(),
    label: exports_external.string().optional()
  })).mutation(async ({ ctx, input }) => {
    const updates = {};
    if (input.isFavorite !== undefined)
      updates.is_favorite = input.isFavorite;
    if (input.label !== undefined)
      updates.label = input.label;
    const { data, error: error46 } = await ctx.supabase.from("pix_keys").update(updates).eq("id", input.id).eq("user_id", ctx.user.id).select().single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao atualizar chave PIX: ${error46.message}`
      });
    }
    return data;
  }),
  deleteKey: protectedProcedure.input(exports_external.object({
    id: exports_external.string().uuid()
  })).mutation(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_keys").update({ is_active: false }).eq("id", input.id).eq("user_id", ctx.user.id).select().single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao deletar chave PIX: ${error46.message}`
      });
    }
    if (!data) {
      throw new TRPCError({
        code: "NOT_FOUND",
        message: "Chave PIX no encontrada"
      });
    }
    return { id: input.id, success: true };
  }),
  getTransactions: protectedProcedure.input(getTransactionsSchema).query(async ({ ctx, input }) => {
    let query = ctx.supabase.from("pix_transactions").select("*", { count: "exact" }).eq("user_id", ctx.user.id).order("created_at", { ascending: false }).range(input.offset, input.offset + input.limit - 1);
    if (input.type) {
      query = query.eq("transaction_type", input.type);
    }
    if (input.status) {
      query = query.eq("status", input.status);
    }
    if (input.startDate) {
      query = query.gte("created_at", input.startDate);
    }
    if (input.endDate) {
      query = query.lte("created_at", input.endDate);
    }
    const { data, error: error46, count } = await query;
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao buscar transaes: ${error46.message}`
      });
    }
    return {
      hasMore: (count || 0) > input.offset + input.limit,
      total: count || 0,
      transactions: data
    };
  }),
  getTransaction: protectedProcedure.input(exports_external.object({
    id: exports_external.string().uuid()
  })).query(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_transactions").select("*").eq("id", input.id).eq("user_id", ctx.user.id).single();
    if (error46) {
      throw new TRPCError({
        code: "NOT_FOUND",
        message: "Transao no encontrada"
      });
    }
    return data;
  }),
  createTransaction: protectedProcedure.input(createPixTransactionSchema).mutation(async ({ ctx, input }) => {
    if (input.transactionType === "scheduled" && !input.scheduledDate) {
      throw new TRPCError({
        code: "BAD_REQUEST",
        message: "Data de agendamento  obrigatria para transaes agendadas"
      });
    }
    const { data, error: error46 } = await ctx.supabase.from("pix_transactions").insert({
      user_id: ctx.user.id,
      transaction_type: input.transactionType,
      status: input.transactionType === "scheduled" ? "pending" : "processing",
      amount: input.amount,
      pix_key: input.pixKey,
      pix_key_type: input.pixKeyType,
      description: input.description,
      recipient_name: input.recipientName,
      recipient_document: input.recipientDocument,
      scheduled_date: input.scheduledDate,
      transaction_id: `TXN${Date.now()}`,
      end_to_end_id: `E${Date.now()}${Math.random().toString(36).slice(2)}`,
      completed_at: input.transactionType !== "scheduled" ? new Date().toISOString() : null
    }).select().single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao criar transao: ${error46.message}`
      });
    }
    if (input.transactionType !== "scheduled") {
      await ctx.supabase.from("pix_transactions").update({ status: "completed" }).eq("id", data.id);
    }
    return data;
  }),
  getStats: protectedProcedure.input(getStatsSchema).query(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.rpc("get_pix_stats", {
      p_period: input.period,
      p_user_id: ctx.user.id
    }).single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao buscar estatsticas: ${error46.message}`
      });
    }
    return data;
  }),
  generateQRCode: protectedProcedure.input(generateQRCodeSchema).mutation(async ({ ctx, input }) => {
    const expiresAt2 = input.expiresInMinutes ? new Date(Date.now() + input.expiresInMinutes * 60 * 1000).toISOString() : null;
    const qrCodeData = `00020126580014br.gov.bcb.pix0136${input.pixKey}520400005303986${input.amount ? `540${input.amount.toFixed(2)}` : ""}5802BR5913${input.description || "AegisWallet"}6009SAO PAULO62070503***6304XXXX`;
    const { data, error: error46 } = await ctx.supabase.from("pix_qr_codes").insert({
      amount: input.amount,
      description: input.description,
      expires_at: expiresAt2,
      is_active: true,
      max_uses: input.maxUses,
      pix_key: input.pixKey,
      qr_code_data: qrCodeData,
      user_id: ctx.user.id
    }).select().single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao gerar QR Code: ${error46.message}`
      });
    }
    return data;
  }),
  getQRCodes: protectedProcedure.query(async ({ ctx }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_qr_codes").select("*").eq("user_id", ctx.user.id).eq("is_active", true).order("created_at", { ascending: false });
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao buscar QR Codes: ${error46.message}`
      });
    }
    return data;
  }),
  deactivateQRCode: protectedProcedure.input(exports_external.object({
    id: exports_external.string().uuid()
  })).mutation(async ({ ctx, input }) => {
    const { data, error: error46 } = await ctx.supabase.from("pix_qr_codes").update({ is_active: false }).eq("id", input.id).eq("user_id", ctx.user.id).select().single();
    if (error46) {
      throw new TRPCError({
        code: "INTERNAL_SERVER_ERROR",
        message: `Erro ao desativar QR Code: ${error46.message}`
      });
    }
    if (!data) {
      throw new TRPCError({
        code: "NOT_FOUND",
        message: "QR Code no encontrado"
      });
    }
    return { id: input.id, success: true };
  })
});

